DROP PROCEDURE IF EXISTS `exec_sql`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `exec_sql`(`v_sqlstr` varchar(1024))
BEGIN
	set 		@sqlstr = v_sqlstr;
	prepare m_str from @sqlstr;
	execute m_str;
END
;;
DELIMITER ;

