DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `exec_sql_print`(`v_sqlstr` varchar(1024))
BEGIN
	select v_sqlstr;
	call exec_sql(v_sqlstr);
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_AddCdKey`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_AddCdKey`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_AddCdKey`(IN v_CdKey varchar(42),IN v_PlayerID int)
    SQL SECURITY INVOKER
lable_1:
BEGIN   
		declare v_ErrCode int default 0;   
		declare v_ErrStr varchar(128) default  'Success!';  

		declare exit handler for sqlexception
		BEGIN
				set v_ErrCode = 3;
				set v_ErrStr = 'mysql error!';
				select v_ErrCode as ErrCode, v_ErrStr as ErrStr;
				rollback;
		END;

		set v_ErrCode = 0;
		set v_ErrStr = 'OrderID is OK!';
		#开启事物
		start transaction; 

		-- 检测CDkey是否被其它玩家使用
		IF  EXISTS ( select 1 from `player_cdkey` where CdKey = v_CdKey and PlayerID <> v_PlayerID)THEN
					set v_ErrCode = 1;
					set v_ErrStr = 'CdKey is other PlayerID Used!';
					select v_ErrCode as ErrCode, v_ErrStr as ErrStr;
					rollback;
					leave lable_1; 
		END IF;
		# 检测玩家是否存在
		IF EXISTS ( select 1 from `player_cdkey` where CdKey = v_CdKey and PlayerID = v_PlayerID )THEN
					set v_ErrCode = 2;
					set v_ErrStr = 'CdKey is PlayerID Used!';
					select v_ErrCode as ErrCode, v_ErrStr as ErrStr;
					rollback;
					leave lable_1; 
		END IF;

		# 在表中插入记录。
		#结束事物
		select v_ErrCode as ErrCode, v_ErrStr as ErrStr;
		commit; 
END
;;
DELIMITER ;

