		#开启事物
		start transaction; 



		-- 检测订单是否存在
		IF  EXISTS ( select 1 from `player_recharge` where OrderID = v_OrderID )THEN
					set v_ErrCode = 2;
					set v_ErrStr = 'OrderID is Processed!';
					select v_ErrCode as ErrCode, v_ErrStr as ErrStr;
					rollback;
					leave lable_1; 
		END IF;
		# 检测玩家是否存在
		IF NOT EXISTS ( select 1 from `players` where PlayerID = v_PlayerID )THEN
					set v_ErrCode = 13;
					set v_ErrStr = 'PlayerID is Not Exit!';
					select v_ErrCode as ErrCode, v_ErrStr as ErrStr;
					rollback;
					leave lable_1; 
		END IF;

		# 直接更新玩家的数据，因为玩家的数据更新不与充值在同一个事物中。有可能存在失败的风险，保证玩家的元宝数在这次事物提交中成功
		#UPDATE players set Pay = Pay + v_Gold, Gold = Gold + v_Gold, TotalRMB = TotalRMB + v_RMB WHERE PlayerID = v_PlayerID;
		# 在订单表中插入订单记录。
		#结束事物
		select v_ErrCode as ErrCode, v_ErrStr as ErrStr;
		commit; 
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_CreateFaction`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_CreateFaction`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_CreateFaction`(IN `v_ZoneID` int, IN `v_PlayerID` int,IN `v_FactionName` varchar(255),IN `v_FactionAnnouncement` varchar(255))
lable:


BEGIN
		DECLARE v_FactionID int UNSIGNED DEFAULT 0;
		DECLARE v_MaxFactionID  int UNSIGNED DEFAULT 0;
		declare v_ErrCode int default 0;  
		declare v_ErrStr varchar(120) default 'Success!';

		declare exit handler for sqlexception
		BEGIN
		 		set v_ErrCode = 99;
		 		set v_FactionID = 0;
		 		select v_ErrCode as errcode, v_FactionID as factionid;
		 		rollback;
		END;

		#开启事物
		start transaction; 

		IF  EXISTS(select 1 from faction where FactionName = v_FactionName ) THEN
		BEGIN
					set v_ErrCode = 5;
					set v_FactionID = 0;
					select v_ErrCode as errcode, v_FactionID as factionid;
					rollback;
					leave lable;
		END;
		END IF;

		IF  EXISTS(select 1 from factionplayer where JoinPlayerID = v_PlayerID and JoinState = 0) THEN
		BEGIN
					set v_ErrCode = 2;
					set v_FactionID = 0;
					select v_ErrCode as errcode, v_FactionID as factionid;
					rollback;
					leave lable;
		END;
		END IF;


		#获取最大的帮派ID
		select MAX(FactionID) into v_MaxFactionID from faction;

		IF v_MaxFactionID is NULL THEN
			BEGIN
					set v_MaxFactionID = 0;
			END;
		END IF;

		#求余数
		set 	  v_MaxFactionID = v_MaxFactionID % 1000000;
		set 		v_FactionID = (v_ZoneID * 1000000) + v_MaxFactionID + 1;


		#Routine body goes here...
		DELETE  from factionplayer where JoinPlayerID = v_PlayerID; 

		RareItemRoomLevel, GymnasiumLevel, FactionFunds, FactionTaskSchedule, ShadeLevel, HotSpringLevel, ColdPrisonLevel, FactionTowerLevel, CreateFactionPlayerID, FactionFundsSum, UpdateTime) 
		VALUES(v_FactionID, v_PlayerID, v_FactionName, 0, 1, '', v_FactionAnnouncement, '', '', now(), 0, 0, 0, '', 0, 0, 0, 0, v_PlayerID, 0, NOW());


		select v_ErrCode as errcode, v_FactionID as factionid;

		commit;   

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_DelBattleLog`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_DelBattleLog`;
DELIMITER ;;
CREATE DEFINER=`root`@`218.5.83.234` PROCEDURE `sp_DelBattleLog`()
    SQL SECURITY INVOKER
lable_1:
begin    
	declare done int default 0; 
	declare v_dbName varchar(255) default ''; 
	declare v_dbTable varchar(255) default ''; 
	declare cur1 cursor for select TABLE_SCHEMA,TABLE_NAME  from information_schema.TABLES where TABLE_SCHEMA like 'ios_app_%' AND TABLE_NAME = 'battlelog';
	

	declare continue handler for sqlstate '02000' set done = 1;
	declare continue handler for sqlstate '23000' set done = 0;



	 declare exit handler for sqlexception
	 begin
			rollback;
	 end; 

	start transaction; 
			open cur1;
			repeat
				fetch cur1 into v_dbName, v_dbTable;
				if not done then
				begin
					#
					set @sqlstr =concat('TRUNCATE TABLE ', v_dbName, '.battlelog');
					#select @sqlstr;
					prepare m_str from @sqlstr;
					execute m_str;
				end;
				end if;
			until done end repeat; 
			close cur1; 
	commit;         
end
;;
DELIMITER ;

